// Whenever you add a file to the './roomType' icon folder, import and export it here

import { ReactComponent as double } from './double.svg';
import { ReactComponent as doubleChosen } from './doubleChosen.svg';
import { ReactComponent as livingRoom } from './livingRoom.svg';
import { ReactComponent as livingRoomChosen } from './livingRoomChosen.svg';
import { ReactComponent as single } from './single.svg';
import { ReactComponent as singleChosen } from './singleChosen.svg';
import { ReactComponent as studio } from './studio.svg';
import { ReactComponent as studioChosen } from './studioChosen.svg';
import { ReactComponent as suite } from './suite.svg';
import { ReactComponent as suiteChosen } from './suiteChosen.svg';
import { ReactComponent as triple } from './triple.svg';
import { ReactComponent as tripleChosen } from './tripleChosen.svg';

export const roomTypeUnchosen = {
  double,
  livingRoom,
  single,
  studio,
  suite,
  triple,
};

export const roomTypeChosen = {
  doubleChosen,
  livingRoomChosen,
  singleChosen,
  studioChosen,
  suiteChosen,
  tripleChosen,
};

export default {
  double,
  doubleChosen,
  livingRoom,
  livingRoomChosen,
  single,
  singleChosen,
  studio,
  studioChosen,
  suite,
  suiteChosen,
  triple,
  tripleChosen,
};
